script: |
  super -f text -I q13502.spq | sort > q13502.out

inputs:
  - name: q13502.spq
    data: |
      SELECT DISTINCT col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT + 12 * + - col0 * + + ( CAST ( + col0 AS INTEGER ) ) + col1 NOT BETWEEN col1 + col2 * col0 AND - 67 * col0;
  - name: tab1

outputs:
  - name: q13502.out
    data: |
